import React from 'react';
import { Grid } from '@material-ui/core';

import Product from './Product/Product';
import useStyles from './styles';

const products = [
    { id: 1, name: 'Shoes', description: 'Basketball Shoes', price: '$220', image: 'https://cdn.vox-cdn.com/thumbor/LU4FwjADsyNwKDor84PySCUkwjI=/1400x788/filters:format(jpeg)/cdn.vox-cdn.com/uploads/chorus_asset/file/21758025/kobe_x_undefeated.jpg' },
    { id: 2, name: 'Shoes', description: 'Running Shoes', price: '$100', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS2BJ8WKJM_K6E_ITgsvwRO2Crdsau9yNHGGA&usqp=CAU'}, 
];

const Products = ({ products }) => {
    const classes = useStyles();
    return (
    <main className ={classes.content}>
        <div className={classes.toolbar} />
        <Grid container justify="center" spacing={4}>
            {products.map((product) =>(
                <Grid item key ={product.id} xs={12} sm={6} md={4} lg={3}>
                    <Product product={product}/> 
                </Grid>
            ))}
        </Grid>
    </main>
    )
}

export default Products;
